    int counter = k;
    int flag = 0;
    for (int j = 1; j < n; j++) {
      printf("%d ", counter); 
      counter += flag == 0 ? 2 : -2;
      if (counter > 9) {
        counter = k - 2;
        flag = 1;
      }
    }
    k += 2;
    printf("\n");
  }
  return 0;
}

